import React from "react";
import Cards from "./Cards";
import Sdata from "./Sdata";

// console.log(Sdata[0]);
function ncard(val){
    return(
        <Cards 
                imgsrc={val.imgscr} 
                category={val.categorys} 
                title={val.titles} 
                link={val.links} />
    );
}

function App(){
    return(
        <>
            <div className="container">
                <h1>Featured Products</h1>                
                {Sdata.map(ncard)}
            </div>
        </>
    );
}   

export default App;
